import React from "react"; 
import "./NewTeam.css"; 
import Navbar from "../Navbar.js"; 
import Card from "./TeamCard";  
import defaultInstructor from "../icons/head-brains.png";
import diana from "./InstructorImages/diana.jpg"; 
import aiswarya from "./InstructorImages/aiswarya.jpeg"; 


export default function NewTeam() {
    return (<div class="new-team-con">
        <Navbar/> 
        <div class="new-team">
        <h1>Physics</h1>
        <div class="con">

                <Card
                    imgURL={aiswarya}
                    name="Aiswarya Saravanan"
                    position="Podcast Creation Lead"
                    des = "Aiswarya Saravanan is a rising junior at Plymouth High School from Michigan, USA. She loves all things STEM and activism, and she is super passionate about neuroscience and biomedicial engineering in general. She is part of Simply Neuroscience and STEM Without Boundaries, where she is the Director of Sponsorships. She also recently started her own non-profit organization called Basically Biomedicine to educate people in the biomedical fields. In STEMEY, she is part of the anatomy team, molecular biology team, and the podcast team, and she is super excited to make a difference!"
                />

                <Card
                    imgURL = {diana}
                    name = "Diana Poplacenel"
                    // position = ""
                    des = "Diana Poplacenel is the Biology and Chemistry Olympiad President at Leigh High School, as well as the treasurer of the Science National Honors Society and a founding member of Science Bowl and Science Olympiad. She is the co-founder of STEM Enrichment Youth and will be leading the neuroscience class. She has experience working with middle school students as an official percussion instructor for Union Middle School. She has completed Harvardâ€™s three Fundamentals of Neuroscience courses as well as four of John Hopkins Bioinformatics courses through Coursera, and is currently in the Biomedical Engineering Innovation program at John Hopkins. She is also a semifinalist in the USA Biology Olympiad."
                /> 


                <Card
                    imgURL={marksandey}
                    name="Mark Sandey"
                    position="Physics Instructor"
                    des = "Mark Sandey is a junior at Arcadia High School in California and is passionate about fields in pure maths and theoretical physics. He is the secretary of the Astrophysics club at AHS and currently spends his free time learning abstract algebra and playing video games. Mark loves to teach other people about topics in mathematics and in physicsand will often opt to help other people with math and physics homework if they need it. He took APCSA last year and got a 5, too. Mark is also a part of AHS's top band as a clarinetist but also has a passion for guitar (if anyone plans to make a class on the physics of music, he'd love to be a part of it). This year he plans to teach Physics at STEMEY and is excited to teach as prart of an organization for the first time ever!"
                />


                <Card
                    name="Keshav Narang"
                    position="Physics Instructor"
                    des = ""
                />

            </div>
        </div>
    </div>
    )
}
